.fabuy {
  width: 100%;
  height: 100%;
  background: #fff;
}
.left {
  width: 65%;
  height: 100%;
  float: left;
  overflow: hidden;
  background:rgba(247,248,255,1);
}
.zhu {
  border: 1px dashed #A0B5FF;
  cursor: move;
}
.zhu .right_bottom {
  width: 40px;
  height: 40px;
  position: relative;
  left: 100%;
  top: 100%;
  margin-left: -20px;
  margin-top: -20px;
  cursor: se-resize;
}
/* 左边窗口信息 */
.right {
  width: 30%;
  height: 100%;
  float: right;
}
.right_header {
  /* 左边头部样式 */
  width: 100%;
  height: 30px;
  text-align: center;
  line-height: 30px;
  font-size: 3vh;
  color: #698EFF;
}
.right_body {
  /* 左边主体样式 */
  width: 100%;
  color: #698EFF;
}
.right_body > div {
  margin-top: 20px;
  width: 100%;
  overflow: hidden;
}
.chuang input {
  /* 名称样式 */
  float: right;
  width: 240px;
}
.wdatali {
  float: left;
  width: 24%;
  font-size: 10px;
  line-height: 200%;
  margin-left: 1%;
  margin-top: 10px;
}
.wdatali .input {
  width: 70%;
  font-size: 10px;
  display: inline-block;
}
/* 表格 */
.tab {
  width: 100%;
  border: 1px solid #698EFF;
}
.tab th,
td {
  border: 1px solid #698EFF;
  height: 20px;
  font-size: 15px;
}
.kongzhi > div {
  float: left;
  width: 15px;
  height: 15px;
  text-align: center;
  margin-left: 10px;
  overflow: hidden;
}
.kongzhi > div > input {
  opacity: 0;
  filter: alpha(Opacity=100);
}
.an div {
  float: left;
  margin-left: 20%;
  width: 20%;
  text-align: center;
  border-bottom: 1px solid #000;
  background: #132987;
  border-radius: 5px;
  color: #fff;
  cursor: pointer;
}
.kongzhi .kongzhi_jia {
  background: url("../../assets/jia.png") no-repeat;
  background-size: 100% 100%;
}
.kongzhi .kongzhi_jian {
  background: url("../../assets/jian.png") no-repeat 50%;
}
.kongzhi .kongzhi_shang {
  background: url("../../assets/shang.png") no-repeat;
  background-size: 100% 100%;
}
.kongzhi .kongzhi_xia {
  background: url("../../assets/xia.png") no-repeat;
  background-size: 100% 100%;
}
